{
  "endpoint_path": "/api/v3/volume/hourly",
  "description": "Get hourly swap volume statistics for Uniswap V3 USDC/ETH pool",
  "method": "GET",
  "path_params": [],
  "query_params": [
    {"name": "startBlockTimestamp", "type": "Option<u64>", "default": "null", "description": "Start of the time range for the query, in Unix timestamp"},
    {"name": "endBlockTimestamp", "type": "Option<u64>", "default": "null", "description": "End of the time range for the query, in Unix timestamp"},
    {"name": "limit", "type": "u32", "default": 50, "description": "Maximum number of hourly records to return"}
  ],
  "response_schema": {
    "name": "HourlyVolumeStatsResponse",
    "fields": [
      {"name": "hour", "type": "i64", "description": "The starting Unix timestamp of the hour"},
      {"name": "swap_count", "type": "i64", "description": "Total number of swaps in the hour"},
      {"name": "total_amount0", "type": "String", "description": "Sum of amount0 swapped in the hour"},
      {"name": "total_amount1", "type": "String", "description": "Sum of amount1 swapped in the hour"}
    ]
  },
  "sql_query": "SELECT DATE_TRUNC('hour', TO_TIMESTAMP(block_timestamp))::BIGINT AS hour, COUNT(*) AS swap_count, SUM(amount0) AS total_amount0, SUM(amount1) AS total_amount1 FROM v3_pool_swaps WHERE ($1::BIGINT IS NULL OR block_timestamp >= $1) AND ($2::BIGINT IS NULL OR block_timestamp <= $2) GROUP BY hour ORDER BY hour DESC LIMIT $3",
  "tables_referenced": ["v3_pool_swaps"]
}
